import React from "react";  

const Card = (props)=>{
    return(
        <>
            <div className="cards">
                <div className="card">
                    <img src="image/photo.jpg" className="card_image" alt=""/>
                    <div className="card_info">
                       <span className="card_category"> <h2> {props.name} </h2> </span>
                       h3.card_title
                    </div>
                </div>
            </div>
        </>
    )
}


export default Card;
